import React, { Fragment } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Header from './components/Header';
import Home from './pages/Home';
import Drawer from './pages/drawer/Drawer';

const App = () => {
  return (
    <Fragment>
      <CssBaseline/>
      <Drawer/>
      <Header/>
      <main>
        <Home/>
      </main>
    </Fragment>
  );
}

export default App;
